import axios from "axios"
import {useState , useEffect} from "react"
import React from 'react'



const Fixtures = () =>{

const [results , setResults] = useState([])



useEffect(()=>{

  const fetchData = async () => {
    try {
      const response = await axios.get("https://v3.football.api-sports.io/rounds?league=39&season=2019", {
        headers: {
          'x-apisports-key': '1977291e-0e24-4ce7-93c7-aacb7b218df1' // Include your API key in the header
        }
      });
      console.log(response.data);
    } catch (error) {
      console.log(error);
    }
  };

  fetchData(); // Call the fetchData function


},[results])



  return <div>
    <h1>
      Fixtures
    </h1>
  </div>

} 

export default Fixtures
